import React, { Component } from 'react';

class SearchBar extends Component {

    render(props) { 
        return ( 
            <div>
                <input 
                    value={this.state.text}
                    onChange={this.props.handleText}
                />
            </div>
         );
    }
}

export default SearchBar;
